import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import App from './pages/App';
import './index.css';

ReactDOM.render(
  <Router>
    <Route path="/app" component={App} />
  </Router>,
  document.getElementById('root')
);
